const {app, BrowserWindow, session, screen} = require('electron');
const getData = require('./getData')
if (require('electron-squirrel-startup')) app.quit();
//Data Auth
let auth;

//Screen size
let screenWidth;
let screenHeight;
//Main window
let authWin;


app.on('window-all-closed', function () {
    let fixIndeces = [];
    let fixValues = []
    getData.populateDataMap(auth).then((ssData) => {
        ssData.records.forEach((dataPoint) => {
            if (dataPoint.status === 'en progreso') {
                fixIndeces.push("M" + dataPoint.dataRow);
                fixValues.push('Sin Comenzar')
            }
        });

        getData.updateCells(auth, fixIndeces, fixValues).then(() => {
            app.quit();
        });

    });


});
//App Listeners
app.on('ready', function () {
    screenWidth = screen.getPrimaryDisplay().size.width
    screenHeight = screen.getPrimaryDisplay().size.height;
    //Init data
    getData.init()
        .then((authToken) => {
            console.log('Data initialized correctly');
            auth = authToken;
            getSSData();
        })
        .catch((err) => {
            console.error(err)
        });

//Create Main

    authWin = new BrowserWindow({
        width: screenWidth,
        height: screenHeight,
        webPreferences: {
            nodeIntegration: true,
            worldSafeExecuteJavaScript: true,
            devTools: true
        }
    });

    authWin.webContents.openDevTools()
    authWin.setMenu(null)
    authWin.loadFile('html/index.html').catch((e) => {
        console.error(e)
    })


});


function getSSData() {
    return new Promise((resolve) => {
        getData.populateDataMap(auth).then((data) => {
            console.log('Data retrieved correctly');
            let selectedRecords = [];
            let records = data.records;
            for (let recordIndex = 0; recordIndex < records.length; recordIndex++) {
                if (records[recordIndex].status === 'sin comenzar' && selectedRecords.length < 3) {
                    selectedRecords.push(records[recordIndex]);
                }
            }


            makeOpWindows(selectedRecords, data.interval).then(() => {
                resolve()
            });
        }).catch((err) => {
            console.error(err)
        });
    })

}

function makeOpWindows(records, interval, xPosition = null) {


    return new Promise(resolve => {

        let ranges = [];
        let values = [];


        let windowWidth = Math.ceil((screenWidth / 3));
        let windowHeight = screenHeight - 200;


        for (let index = 0; index < records.length; index++) {
            let xOffset = xPosition ? xPosition : (windowWidth * index)
            let yOffset = 200;
            //Create op wins
            let windowNumber = parseInt(xOffset / windowWidth);
            let ses = session.fromPartition(windowNumber.toString(), {cache: false})
            ranges.push('M' + records[windowNumber].dataRow);
            values.push('En Progreso');

            let win = new BrowserWindow({
                webPreferences: {
                    session: ses
                },
                width: windowWidth,
                height: windowHeight,
                x: xOffset,
                y: yOffset,
                parent: authWin,
                show: false,
                frame: true,
                devTools: true

            });
            win.webContents.openDevTools()

            fillTurnForms(win, records[windowNumber], interval);
            console.log('Window ' + windowNumber + ' created');

            win.loadURL('https://sede.administracionespublicas.gob.es/pagina/index/directorio/icpplus').then(() => {
                console.log('Window ' + windowNumber + ' loaded');
                ses.cookies.get({url: 'sede.administracionespublicas.gob.es'}).then((value) => {
                    console.log(value)
                })
            }).catch((e) => {
                console.error(e);
            });
            win.webContents.on('close', (e) => {
                let history = e.sender.history;
                let lastPage = history[history.length - 1]

                if (lastPage.indexOf('#success') > -1) {
                    getData.updateCells(auth, ['M' + records[windowNumber].dataRow], ['Finalizado']).then(() => {
                        console.log('Success!');
                    }).catch((e) => {
                        console.error(e)
                    });

                } else {
                    // Respawn window

                    makeOpWindows([records[windowNumber]], interval, e.sender.browserWindowOptions.x).then(() => {
                        fillTurnForms(win, records[windowNumber], interval);
                    })

                }
            })

            win.once('ready-to-show', () => {
                win.show();
                authWin.webContents.send('ping', 'window loaded');
                console.log('Window ' + windowNumber + ' ready to show.')

            })
            if (index === records.length - 1) {
                getData.updateCells(auth, ranges, values).then(() => {
                    resolve();
                })

            }
        }
    })

}

